import React, { useState } from "react";
import { Link } from "react-router-dom";

const AdminDashboard = () => {
  const [activeTab, setActiveTab] = useState("salesReport");

  const renderContent = () => {
    switch (activeTab) {
      case "salesReport":
        return <div>Sales Report Content</div>;
      case "reservations":
        return <div>Reservations Content</div>;
      case "revenueByCustomer":
        return <div>Revenue by Customer Content</div>;
      case "activeTransitLines":
        return <div>Active Transit Lines Content</div>;
      default:
        return null;
    }
  };

  return (
    <div>
      <h1>Admin Dashboard</h1>
      {/* Link to Manage Employees */}
      <Link to="/manage-employees" style={{ color: "purple", textDecoration: "underline" }}>
        Manage Employees
      </Link>

      {/* Tabs for other functionalities */}
      <div style={{ display: "flex", marginTop: "20px" }}>
        <button onClick={() => setActiveTab("salesReport")}>Sales Report</button>
        <button onClick={() => setActiveTab("reservations")}>Reservations</button>
        <button onClick={() => setActiveTab("revenueByCustomer")}>Revenue by Customer</button>
        <button onClick={() => setActiveTab("activeTransitLines")}>Active Transit Lines</button>
      </div>

      {/* Render Tab Content */}
      <div style={{ marginTop: "20px" }}>{renderContent()}</div>
    </div>
  );
};

export default AdminDashboard;
